  bmlfAddLineLotNo(pobjEvent) {
    debugger;
    let pnQuantity = 0;
    if (this.mArrGrid1[this.miSelectedItemRowIndex].seriallotflg == "L" || this.mArrGrid1[this.miSelectedItemRowIndex].seriallotflg == "B") {
      pnQuantity = 0.01;
    } else if (this.mArrGrid1[this.miSelectedItemRowIndex].seriallotflg == "S") {
      pnQuantity = 1;
    }
    let pobjDataCopy = this.mArrGrid2AllData.filter(x => x['PhysicalCountOrdNo'] == '');
    pobjDataCopy.ApprovedBy = '';
    pobjDataCopy.BinNo = pobjEvent.value["BinNo"];
    pobjDataCopy.ContainerNo = this.bmlfGetContainerNumber();
    ;
    pobjDataCopy.CountBy = '';
    pobjDataCopy.LotNo = pobjEvent.value["LotNo"];
    pobjDataCopy.PhysicalCountOrdNo = this.msPhysicalCountOrdNo;
    pobjDataCopy.QtyActual = pnQuantity;
    pobjDataCopy.QtyAdjusted = pnQuantity;
    pobjDataCopy.Qtyonhand = 0;
    pobjDataCopy.RowNumber = this.getMaxSrNo();
    pobjDataCopy.RowStatus = 'NA';
    pobjDataCopy.Status = '';
    pobjDataCopy.TagNo = '';
    pobjDataCopy.VerifiedBy = '';
    this.mArrGrid2AllData.push(pobjDataCopy);
    this.mArrGrid2 = this.mArrGrid2AllData.filter(x => x['PhysicalCountOrdNo'] == this.msPhysicalCountOrdNo);
    this.bmlfLotAdjust(this.mArrGrid2.length - 1);
    this.bmlfSetLineData();
    this.mbChange = true;
  }
  getMaxSrNo() {
    let parrGrid = this.mArrGrid2AllData.filter(x => x['PhysicalCountOrdNo'] == this.msPhysicalCountOrdNo);
    let pmaxnumber = 0;
    parrGrid.forEach(ele => {
      if (ele.RowNumber > pmaxnumber) {
        pmaxnumber = ele.RowNumber;
      }
    });
    return pmaxnumber + 1;
  }
  bmlfGetContainerNumber() {
    if (this.mbAllowContainer == false) {
      return 0;
    } else {
      let pmaxnumber = 0;
      this.mArrGrid2.forEach(ele => {
        if (ele.ContainerNo > pmaxnumber) {
          pmaxnumber = ele.ContainerNo;
        }
      });
      return pmaxnumber + 1;
    }
  }
